import React from "react";

const WeatherIcon = props => (
  <>
    {props.condition.toLowerCase() === "clear" ? props.activeIcon : props.icon}
    {props.description === "few clouds" ? props.activeIcon : props.icon}
  </>
);

export default WeatherIcon;
